-- ----------------------------
-- Function structure for avail_seat_consistency
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."avail_seat_consistency"();
CREATE OR REPLACE FUNCTION "public"."avail_seat_consistency"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
	UPDATE leg_instances SET no_of_avail_seats = no_of_avail_seats-1
	FROM fares INNER JOIN flight_legs ON flight_legs."id"=fares.flight_id
	
	WHERE leg_instances.flight_leg_id = flight_legs.id AND NEW.flight_id=flight_legs.flight_id
	;

	RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for c
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."c"();
CREATE OR REPLACE FUNCTION "public"."c"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
	UPDATE customers SET mileage_sum = mileage_sum+(SELECT SUM (mileage) FROM
	leg_instances INNER JOIN flight_legs ON leg_instances.flight_leg_id =flight_legs.id
	INNER JOIN fares ON NEW.flight_id=flight_legs."id"
	)
	WHERE NEW.customer_id = customers."id"
	
	
				;
RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for check_land_time
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."check_land_time"();
CREATE OR REPLACE FUNCTION "public"."check_land_time"()
  RETURNS "pg_catalog"."trigger" AS $BODY$ BEGIN
SELECT
	flights.weekdays,
	flight_legs.arrival_airport_code,
	flight_legs.scheduled_arr_time 
FROM
	flight_legs
	INNER JOIN flights ON flight_legs.flight_id = flights."id" 
WHERE
	weekdays = flights."weekdays"
	AND arrival_airport_code = flight_legs."arrival_airport_code"
	AND scheduled_arr_time > TO_TIMESTAMP(flight_legs."scheduled_arr_time", '%H:%i:%S') - INTERVAL '5 minutes'
	AND scheduled_arr_time < TO_TIMESTAMP(flight_legs."scheduled_arr_time", '%H:%i:%S') + INTERVAL '5 minutes';
	
	
		RETURN NEW;
	
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for control_airplane_can_land
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."control_airplane_can_land"();
CREATE OR REPLACE FUNCTION "public"."control_airplane_can_land"()
  RETURNS "pg_catalog"."trigger" AS $BODY$ BEGIN
	IF
		(
		SELECT COUNT
			( * ) 
		FROM
			can_land
			INNER JOIN airports ON can_land.airport_code = airports.code
			INNER JOIN airplane_types ON can_land.airplane_type_id = airplane_types."id"
			INNER JOIN airplanes ON airplane_types."id" = airplanes.airplane_type_id 
		WHERE
			airplanes."id" = NEW."airplane_id" 
			AND can_land.airport_code IN ( NEW.arrival_airport_code ) 
			) = 0 THEN
			RAISE EXCEPTION 'Bu airporta inemez';
		
	END IF;
	IF
		(
		SELECT COUNT
			( * ) 
		FROM
			can_land
			INNER JOIN airports ON can_land.airport_code = airports.code
			INNER JOIN airplane_types ON can_land.airplane_type_id = airplane_types."id" 
		WHERE
			airplanes."id" = NEW."airplane_id" 
			AND can_land.airport_code IN ( NEW.departure_airport_code ) 
			) = 0 THEN
			RAISE EXCEPTION 'Bu airporttan uamaz';
		
	END IF;
	RETURN NEW;
	
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for customer_update_mileage_sum
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."customer_update_mileage_sum"();
CREATE OR REPLACE FUNCTION "public"."customer_update_mileage_sum"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
	UPDATE customers SET mileage_sum = (
				SELECT SUM
				( leg_instances.mileage )
			FROM
				fares
				INNER JOIN flights ON fares.flight_id = flights."id"
				INNER JOIN flight_legs ON flights."id" = flight_legs.flight_id
				INNER JOIN leg_instances ON flight_legs."id" = leg_instances.flight_leg_id 
			WHERE
				fares.customer_id = (SELECT customer_id FROM fares WHERE id = NEW."id" LIMIT 1)
			)
			WHERE id = (SELECT customer_id FROM fares WHERE id = NEW."id" LIMIT 1);
RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for ffc_degree_function
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."ffc_degree_function"();
CREATE OR REPLACE FUNCTION "public"."ffc_degree_function"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
	IF(NEW.mileage_sum) <= 5000 THEN
	UPDATE ffcs SET ffc_degree =1 WHERE NEW.id = ffcs.customer_id;

	
	ELSIF(NEW.mileage_sum) >5000 AND (NEW.mileage_sum) <= 10000 THEN
	UPDATE ffcs SET ffc_degree =2 WHERE NEW.id = ffcs.customer_id;

	
	ELSE 
	UPDATE ffcs SET ffc_degree =3 WHERE NEW.id = ffcs.customer_id;
	END IF;


RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for seat_control
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."seat_control"();
CREATE OR REPLACE FUNCTION "public"."seat_control"()
  RETURNS "pg_catalog"."trigger" AS $BODY$ BEGIN
	
	
	
	IF(
	SELECT no_of_avail_seats
	FROM leg_instances INNER JOIN flight_legs ON leg_instances.flight_leg_id=flight_legs."id"
	
	WHERE NEW.flight_id = flight_legs.flight_id LIMIT 1
	
	
	)<=0
	THEN
	
	RAISE EXCEPTION 'UCAK DOLMUSTUR';
	
		
	END IF	;
	

	
	RETURN NEW;
	
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- View structure for ucak_listesi
-- ----------------------------
DROP VIEW IF EXISTS "public"."ucak_listesi";
CREATE VIEW "public"."ucak_listesi" AS  SELECT airplane_types.name AS airplane_type,
    airlines.name AS airline,
    airplane_companies.name AS manufacturer
   FROM airplanes
     JOIN airlines ON airplanes.airline_id = airlines.id
     JOIN airplane_companies ON airplanes.airplane_company_id = airplane_companies.id
     JOIN airplane_types ON airplanes.airplane_type_id = airplane_types.id;

-- ----------------------------
-- View structure for First Class umu mteriler
-- ----------------------------
DROP VIEW IF EXISTS "public"."First Class umu mteriler";
CREATE VIEW "public"."First Class umu mteriler" AS  SELECT customers.name,
    customers.email,
    customers.address,
    customers.country,
    customers.id
   FROM fares
     JOIN customers ON fares.customer_id = customers.id
  WHERE fares.restrictions::text = 'FIRST CLASS'::text;

